import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const UpdateUser = () => {
  return (
    <View>
      <Text>UpdateUser</Text>
    </View>
  )
}

export default UpdateUser

const styles = StyleSheet.create({})
